import React from 'react'

import {Grid, Box} from "@material-ui/core"
import Moves from "./Mapa"
const Direccion = () => {
    return (
        <Grid item xs={12}>
            <Box

                border={2}
                borderRadius={5}
                borderColor="#A0A6A9"
                textAlign="justify"
                padding={5}

            >
                Esta es la direccion
            <Moves />
            </Box>
        </Grid>
    )
}

export default Direccion;
